import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title = 'ajProject';
  public LoginForm: string = "valid";
  constructor(){}
  ngOnInit(): void {
    let LoginForm = localStorage.getItem('userRole');
    console.log('userRole from localStorage', LoginForm);
  }

}
